import React from "react";

const DetailImageStyle = {
  backgroundImage: url("/details-wine.jpg"),
  width: 180 /* ※縦横を同値に */,
  height: 180 /* ※縦横を同値に */,
  borderRadius: "50%" /* 角丸半径を50%にする(=円形にする) */,
  backgroundPosition: "left top" /* 横長画像の左上を基準に表示 */,
  display: "inline-block",
};

export default function DetailImage() {
  <div style={DetailImageStyle} />;
}
